    margin: 0;
    padding: 0;
    box-sizing: border-box;
    touch-action: none;
    user-select: none;
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    -webkit-touch-callout: none;
    -webkit-user-drag: none;
    -webkit-tap-highlight-color: transparent;
}

html,
body {
    background: #111;
    width: 100%;
    height: 100%;
    overflow: hidden;
    margin: 0;
}

body {
    position: relative;
    /* padding-top: env(safe-area-inset-top);
    padding-right: env(safe-area-inset-right);
    padding-bottom: env(safe-area-inset-bottom);
    padding-left: env(safe-area-inset-left); */
}

#main {
    position: fixed;  /* fixed вместо absolute для стабильного позиционирования */
    left: 0;
    top: 0;
    right: 0;
    bottom: 0;
    display: flex;
    align-items: center;    /* вертикальное центрирование */
    justify-content: center; /* горизонтальное центрирование */
    visibility: hidden;
    background: #111;
    width: 100%;
    height: 100%;
}

#main > div {
    position: fixed;  /* relative вместо absolute */
    width: 100%;
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
}

#canvas3d,
#canvas2d {
    position: absolute;
    display: block;
}
